 beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Wzc='Dimension',qlc='Dimension [height=',jwc='DirectionalTextHelper',mwc='DockLayoutPanel',nwc='DockLayoutPanel$Direction',owc='DockLayoutPanel$Direction;',rwc='DockLayoutPanel$DockAnimateCommand',pwc='DockLayoutPanel$LayoutData',vsc='DomEvent',Asc='DomEvent$Type',Eyc='Double',ric='EAST',Dcc='EEE, d MMM yyyy HH:mm:ss Z',moc='EEE. dd MMM. yyyy HH:mm:ss',Xcc='EEEE, MMMM d',Gcc='EEEE, MMMM d, y',iac='EM',Yfc='EMPTY',bgc='ENABLED',iec='END',kac='EX',Suc='ElementMapperImpl',Tuc='ElementMapperImpl$FreeNode',Zdc='English',Irc='Enum',Qdc='Etc/GMT',Sdc='Etc/GMT+',Rdc='Etc/GMT-',zac='Event type',Kxc='Event$NativePreviewEvent',Nsc='EventBus',Zqc='EventObject',crc='Exception',Xgc='Expecting version 6 from server, got ',ubc='F',vmc='F8834F07517EF3B7D02B9E845E5E1B88',dac='FIXED',thc='FLOAT',amc='Fail: ',Obc='Feb',Cbc='February',Spc='Female',Fyc='Float',swc='FlowPanel',Svc='FocusWidget',skc='For input string: "',qcc='Fri',jcc='Friday',Nac='GET',Doc='GGD55XLBAH',oqc='GGD55XLBAJ',Bpc='GGD55XLBBI',Coc='GGD55XLBCH',Dpc='GGD55XLBCI',zfc='GGD55XLBDB',Boc='GGD55XLBDH',xqc='GGD55XLBDJ',kpc='GGD55XLBDK',_ec='GGD55XLBEB',zoc='GGD55XLBEH',Cpc='GGD55XLBEI',pqc='GGD55XLBEJ',Afc='GGD55XLBFB',Goc='GGD55XLBFH',$pc='GGD55XLBFI',Qqc='GGD55XLBFK',Xpc='GGD55XLBGI',Oqc='GGD55XLBGK',Dfc='GGD55XLBHB',Ooc='GGD55XLBHH',Lpc='GGD55XLBHI',Nqc='GGD55XLBHK',Qoc='GGD55XLBIH',Kqc='GGD55XLBIK',Poc='GGD55XLBJH',Lnc='GGD55XLBJJ',Pqc='GGD55XLBJK',_oc='GGD55XLBKG',wpc='GGD55XLBKH',_pc='GGD55XLBKI',Fqc='GGD55XLBKK',Yoc='GGD55XLBLG',vpc='GGD5
